	add("chemolithotroph", "{\"term\":\"chemolithotroph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|chemo|lithotroph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"chemoautotroph\", \"priority\":1}]}, \"synonyms\":{}}");

