	add("chemosynthesis", "{\"term\":\"chemosynthesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|chemo|synthesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the production of carbohydrates and other compounds from simple compounds such as carbon dioxide, using the oxidation of chemical nutrients as a source of energy rather than sunlight; it is limited to certain bacteria and fungi\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chemotaxis", "{\"term\":\"chemotaxis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|chemo|taxis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the movement of a cell or an organism in response to a chemical stimulant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chemotherapy", "{\"term\":\"chemotherapy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|chemo|therapy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any chemical treatment intended to be therapeutic with respect to a disease state\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chemical treatment to kill or halt the replication and/or spread of cancerous cells in a patient\", \"priority\":2}]}, \"synonyms\":{}}");

