	add("chenille", "{\"term\":\"chenille\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|chenille|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an extremely soft and bunchy fabric often used to make sweater\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027\u0027, Chapter VII, Section v\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The house seemed unfamiliar in the dark stormy light; the red and purple glass of the front door made livid bruises on the linoleum; the green \u0027\u0027chenille\u0027\u0027 curtain was like a veil of seaweed\", \"priority\":3}]}, \"synonyms\":{}}");

