	add("cherub", "{\"term\":\"cherub\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"ancient greek (to 1453)\", \"Hebrew\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|cerubin}}, from {{m|la|cherub}}, from Ancient greek (to 1453) {{m|grc|χερούβ}}, ultimately from Hebrew {{m|he|כרוב| כְּרוּב|tr\u003d kerúv}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A winged creature represented over 90 times in the Bible as attending on God, later seen as the second highest order of angels, ranked above thrones and below seraphim. First mention is in [http://en.wikisource.org/wiki/Bible_%28World_English%29/Genesi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Chapter_3 Genesis 3:24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A statue or other depiction of such a being, typically in the form of a winged child\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person, especially a child, seen as being particularly innocent or angelic\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chervil", "{\"term\":\"chervil\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman (compare Jèrriais \u0027chèrfi\u0027 , from Latin \u0027chaerephylla\u0027 from Ancient greek (to 1453) \u0027χαιρέφυλλον\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A leafy herb, resembling parsley\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"leaves from the plant, used as an herb in cooking, which have a mild flavour of anise\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chesterfieldian", "{\"term\":\"chesterfieldian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Chesterfield|ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who acts in a sophisticated, aristocratic manner, reminiscent of the\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027, review of \u0027Studies in Montaigne\u0027, in \u0027The Nation\u0027 (volume 80, no 2067, Feb 9, 1905) [http://books.google.com/books?id\u003dDhg4AQAAMAAJ\u0026amp;dq\u003dchesterfieldian\u0026amp;pg\u003dPA11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dchesterfieldian\u0026amp;f\u003dfalse p. 118\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For example, in the chapter on “The Imperial Family,\u0026quot; by Baron Sannomiya, this consummate \u0027\u0027Chesterfieldian\u0027\u0027, who acts as the court chamberlain, tells us what went on\u0026amp;mdash;outside of the imperial family\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chestertonian", "{\"term\":\"chestertonian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Chesterton|ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who supports G. K. Chesterton, especially in his theology\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1921\u0027\u0027, review of \u0027The New Jerusalem\u0027, in \u0027The Catholic World\u0027 (volume 113, no 674), May 1921 [http://books.google.com/books?id\u003dRzY7AQAAMAAJ\u0026amp;dq\u003dChestertonian\u0026amp;pg\u003dPA24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dChestertonian\u0026amp;f\u003dfalse p. 241\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The children of light, whether they are \u0027\u0027Chestertonians\u0027\u0027 or not, cannot afford to pass by \u0027The New Jerusalem\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Jan Morris, \u0027The World: Travels 1950\u0026amp;ndash;2000\u0027 (W. W. Norton \u0026amp; Company) [http://books.google.com/books?id\u003dzaTRIPsXsAkC\u0026amp;lpg\u003dPA68\u0026amp;dq\u003dchestertonian\u0026amp;pg\u003dPA6\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dchestertonian\u0026amp;f\u003dfalse p. 68\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"All this upsets our \u0027\u0027Chestertonian\u0027\u0027, who, reflecting that Britannia needs no boulevards, no spaces wide and gay, feels it somehow irritating that the French should need them either\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chestnut", "{\"term\":\"chestnut\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Formerly \u0027chesten\u0027 \u0027nut\u0027 from Middle english (1100-1500) \u0027chasteine\u0027 from Old french (842-ca. 1400) \u0027chastaigne\u0027 from Latin \u0027castanea\u0027 from Ancient greek (to 1453) \u0027καστάνεια\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tree or shrub of the genus \u0027Castanea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The nut of this tree or shrub\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A dark, reddish-brown colour/color\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A reddish-brown horse\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The wood of a chestnut tree\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Often \u0026quot;old chestnut\u0026quot;) A worn-out meme; a phrase, etc. so often repeated as to have grown tiresome\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A round or oval horny plate found on the inner side of the leg of a horse or other animal, similar to a birthmark on a human\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"horse-chestnut\", \"priority\":8}]}, \"synonyms\":{}}");

	add("chevalier", "{\"term\":\"chevalier\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) from Latin \u0027caballus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cavalier; a knight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In tarot cards, the card between the valet and the dame\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chevon", "{\"term\":\"chevon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027chèvre\u0027 (goat)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The meat of a goat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, C. Devendra, P. Gardiner (editors), \u0027Annex 3: The Phillippine small ruminant industry\u0027, \u0027Global Agenda for Livestock Research\u0027, [http://books.google.com.au/books?id\u003dNzsx5LMcbNEC\u0026amp;pg\u003dPT183\u0026amp;dq\u003d%22chevon%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d8MYvU4yBK4imkwX8joCoBw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chevon%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"While goats are already established as a good source of meat (\u0027\u0027chevon\u0027\u0027) and milk, sheep are relatively new requiring further attention in terms of promotion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Mary Turner Stille, \u0027The Goat Care Handbook\u0027, 2nd Edition, [http://books.google.com.au/books?id\u003d1bfkRqELZEcC\u0026amp;pg\u003dPT403\u0026amp;dq\u003d%22chevon%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d8MYvU4yBK4imkwX8joCoBw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chevon%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Chevon\u0027\u0027 is the meat from the goat. \u0027\u0027Chevon\u0027\u0027 is sold in finer restaurants as a delicacy for huge prices. It\u0027s been reported that \u0027\u0027chevon\u0027\u0027 steaks can cost over $45 on the East Coast, yet many people refuse to taste is when it is served from our kitchen\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Kenneth V. Oster, \u0027The Complete Guide to Preserving Meat, Fish, and Game\u0027, [http://books.google.com.au/books?id\u003dbba8f3a89TQC\u0026amp;pg\u003dPA181\u0026amp;dq\u003d%22chevon%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d8MYvU4yBK4imkwX8joCoBw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chevon%22\u0026amp;f\u003dfalse page 181\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"If you cook \u0027\u0027chevon\u0027\u0027 using too high of a heat setting, the meat will lose its moisture and become tough\", \"priority\":10}]}, \"synonyms\":{}}");

